import {Navigate} from "react-router-dom";
import About from "../pages/About";
import Home from "../pages/Home";
import Message from '../pages/news'
import News from "../pages/news";

//路由表
export default [
    {
        path:'/about',
        element:<About/>
    },
    {
        path:'/home',
        element:<Home/>,
        children:[{
            path:'News',
            element:<news/>
        },
            {
                path:'Message',
                element:<message/>
            }
        ]
    },
    {
        path:'/',
        element:<Navigate to="/home"/>
    }
]
